import React from 'react'

const ProfilePicture = ({profile}) => {
  console.log("auth", profile)
  return(
    <div>
      <div className="picture">
        <img src={profile.pictureUrl} alt="dp"/>
      </div>
    </div>
  )
}

export default ProfilePicture
